A crescente complexidade dos processos de contratação pública, aliada à necessidade de conformidade com normativos como o Decreto nº 12.174/2024 e os entendimentos do TCU (Acórdão nº 1.207/2024), exige domínio técnico aprofundado sobre:

Estrutura e metodologia de cálculo das planilhas;
Aspectos legais e trabalhistas (CCT, ACT, DCT);
Regimes tributários e impactos na formação de preços;
Avaliação da exequibilidade das propostas e equilíbrio econômico-financeiro dos contratos.
O curso oferece abordagem prática e teórica, com aplicação de exercícios e oficinas que simulam situações reais enfrentadas pelas equipes, além de mentoria exclusiva para aprofundamento e resolução de dúvidas específicas. Essa estrutura garante aplicabilidade imediata do conteúdo às rotinas institucionais.

A participação dos funcionários no curso proporcionará os seguintes benefícios ao CREA-SP:

Fortalecimento da capacidade técnica da equipe responsável pelo planejamento e gestão contratual;
Redução de riscos jurídicos e financeiros, por meio da correta elaboração de orçamentos estimativos e análise de propostas;
Padronização metodológica na construção de planilhas de custos, promovendo maior segurança e transparência nos processos;
Melhoria da eficiência administrativa, com decisões mais assertivas e fundamentadas;
Aprimoramento da governança pública, em consonância com os princípios da economicidade, eficiência e legalidade previstos na Lei nº 14.133/2021;
Destaca-se a experiencia do instrutor responsável pelo curso, João Domingues - Auditor Federal da Controladoria Geral da União (CGU), com ampla experiência em orçamento público, gestão contratual e fiscalização de contratos. É mestre em Administração Pública, professor convidado em cursos de pós-graduação e capacitações promovidas por escolas de governo, além de conferencista em eventos nacionais sobre contratações públicas. Sua atuação técnica e acadêmica é amplamente reconhecida, o que configura notória especialização e autoridade na matéria abordada no curso.

- Vigência do Contrato nº 16/2019-JFPE - Execução de serviços de apoio técnico-administrativo e de atividades auxiliares a serem prestados no edifício-sede, Fórum Social Desembargador Neves Filho (Juizados Especiais Federais) e nas sedes das Subseções Judiciárias de Petrolina, Caruaru, Serra Talhada, Salgueiro, Garanhuns, Goiana, Palmares, Ouricuri, Arcoverde, Jaboatão dos Guararapes e Cabo de Santo Agostinho - que se encerrará no próximo dia 24/11/2025, sem a possibilidade de renovação contratual;

- Necessidade da manutenção da continuidade dos serviços de apoio administrativo nas localidades atendidas pelo contrato ainda vigente, citado anteriormente;

- Não finalização dos documentos necessários ao processo licitatório para nova contratação, em especial o termo de referência, que precisou ser retificado, com vistas a ajustar ao novo modelo da Advocacia-Geral da União para serviços dessa espécie e ainda

- Existência de grande demanda de tarefas dos setores envolvidos na confecção dos documentos preparatórios para um novo certame, que contribuíram para o atraso de suas finalizações em tempo hábil para conclusão do processo licitatório, disso resultando a situação emergencial ora vivenciada.
